import React from 'react';

const Title =()=>{
    return(
        <div className="title">
            <h1>PhotoGram</h1>
            <h2>Your Pictures</h2>
            <center>
                <p>Add Some More to your PhotoGram</p>
            </center>
            </div>
    )
}

export default Title;
